eel sore?5. Which part of your body is affected?6. Show me where the pain is?7. Tell me where the pain is..?[16/01, 10:52 pm] Athira Renjith: *Asking about the duration* 1. When did it start?2. How long have you had it?3. How long have you been feeling like this?4. How often has this been occurring?5. How long have you been suffering from this problem?6. When did the problem start?7. Have you ever had anything like this before?[16/01, 10:52 pm] Athira Renjith: *Communicating with challenging or withdrawn patients*1. You seem very low in yourself. Can you tell me what\'s going on?2. You appear very distant. Why is that?3. You seem very sad. Can I ask what you are thinking?4. I can see that you look very anxious.  Would you mind telling me what is bothering you?1. I understand this is very difficult for you talk about it. 2. That must be very challenging for you. 3. I can understand it\'s hard as it\'s a big change in your life, and it\'s natural to feel overwhelmed.  Having said that, I am here to assist you .4. I know it must be distressing you. That being said, I am here to help you.5. Being a mother I can understand your situation dear.6. Don\'t worry dwar, if I was you ..I could react to this in this same way.[16/01, 10:52 pm] Athira Renjith: *Smoking*1. Do you smoke?2. How often do you smoke?3. How many cigarettes do you smoke per day?4. Have you done any attempts to quit this habbit before?5. How long have you had this habbit?[16/01, 10:52 pm] Athira Renjith: *Alcoholism*1. Do you drink?2. How often do you drink?3. How many pegs do you takes per day?4.  Have you done any attempts before to quit this habbit before?5. How long have you had this habit?[16/01, 10:52 pm] Athira Renjith: *Restate* From our conversation I understood that you have ......      OrThis is what I understood from what we have discussed so far........Am I right in catching what you share?   OrAm I right in understanding you?     OrAm I correct in understanding you?.Apart from this , would yo