ral questions to understand your condition. Would that be ok?*To give me a better understanding of your situation, is it oky if I can ask you some questions?*If you don\'t mind, I am just going to ask you a few questions about your condition. Would that be ok?*If you don\'t mind ,I want to ask some questions about your condition. It will help me to assess your condition in a better way.will that be ok?','2025-01-20 21:39:14',0,1,'',NULL,NULL),(2464,46,266,'*Polite words**Could you mind if you telling me about.....Would you mind if you telling me about....Could you please tell me regarding....Do you mind if you telling me about....Would you please explain me regarding....','2025-01-20 21:39:34',0,1,'',NULL,NULL),(2465,46,266,'*Open ended questions* 1. How are you doing today?2. How are you feeling?3. How is everything going?4. What brings you here today?5. What seems to be the problem?6. What brought you to the hospital?7. What did you eat today?8. Why didn\'t you seek any treatment earlier?9. Why did you cease taking your medication?10. Tell me about your pain? *Closed ended questions*1. Do you exercise?2. Are you feeling any pain?3. Did you take any medications before coming here?4. Are you allergic to anything?5. Do you have any ongoing medical condition?6. Have you ever been hospitalized?7. Have you ever had any surgeries?8. Is anyone in your family suffering from this condition?9. Has your appetite/weight changed recently?10. Are you taking any medication?','2025-01-20 21:39:44',0,1,'',NULL,NULL),(2466,46,266,'*Questions regarding pain*1. Do you have pain?2. Could you please rate your pain according to the painscale were 0 is no pain and 10 is highest3. Is the pain dull or sharp?4. What is the pain like?5. How severe is the pain?6. Does it disturb you at night?7. Does it feel numb?8. Does it occurs all of the time or just now and again?9. How long have you had this pain?10.where does it hurts exactly?11. How long does it last?12. When did the pain starts?13. Do you ever get the pain at night?14. Are you in pain at the moment?','2025-01-20 21:39:55',0,1,'',NULL,NULL),(2467,46,266,'*Asking about the location of the problem* 1. Where is the sensation?2. Can you tell me what it hurts?3. Where do you feel sore?4. Where does it feel sore?5. Which part of your body is affected?6. Show me where the pain is?7. Tell me where the pain is..?','2025-01-20 21:45:41',0,1,'',NULL,NULL),(2468,46,266,'*Asking about the duration* 1. When did it start?2. How long have you had it?3. How long have you been feeling like this?4. How often has this been occurring?5. How long have you been suffering from this problem?6. When did the problem start?7. Have you ever had anything like this before?','2025-01-20 21:46:25',0,1,'',NULL,NULL),(2469,46,266,'*Communicating with challenging or withdrawn patients*1. You seem very low in yourself. Can you tell me what\'s going on?2. You appear very distant. Why is that?3. You seem very sad. Can I ask what you are thinking?4. I can see that you look very anxious.  Would you mind telling me what is bothering you?1. I understand this is very difficult for you talk about it. 2. That must be very challenging for you. 3. I can understand it\'s hard as it\'s a big change in your life, and it\'s natural to feel overwhelmed.  Having said that, I am here to assist you .4. I know it must be distressing you. That being said, I am here to help you.5. Being a mother I can understand your situation dear.6. Don\'t worry dwar, if I was you ..I could react to this in this same way.','2025-01-20 21:46:39',0,1,'',NULL,NULL),(2470,46,266,'*Smoking*1. Do you smoke?2. How often do you smoke?3. How many cigarettes do you smoke per day?4. Have you done any attempts to quit this habbit before?5. How long have you had this habbit?','2025-01-20 21:46:50',0,1,'',NULL,NULL),(2471,46,266,'*Alcoholism*1. Do you drink?2. How often do you drink?3. How many pegs do you takes per day?4.  Have you done any attempts before to quit this habbit before?5. How long have you had this habit?','2025-01-20 21:47:01',0,1,'',NULL,NULL),(2472,46,266,'*Restate* From our conversation I understood that you have ......      OrThis is what I understood from what we have discussed so far........Am I right in catching what you share?   OrAm I right in understanding you?     OrAm I correct in understanding you?.Apart from this , would you like to add anything to this?   OrWould you like to supplement anything other than this?       OrIn addition,  would you like to supplement anything additional information related to what we have discussed so far.....ok! Now we can talk about the treatment modalities    OrLet\'s talk about how to tackle with it.','2025-01-20 21:47:13',0,1,'',NULL,NULL),(2473,46,266,'*Empathy/consoles*1. I can understand your perspective 2. I can understand your concerns3. I am able to grab your situation 4. I am in a position to feel your feelings 5. I really perceive your feelings 6. Don\'t worry 7. No need to be worried 8. Please don\'t worry too much 9. Don\'t be get alarmed about10. Your concerns are really reasonable11. I am really sorry to hear that 12. It must have been very painful13. It must be stressed for you','2025-01-20 21:47:23',0,1,'',NULL,NULL),(2474,46,266,'*Checking understanding of the patient* 1. Is that right?2. Is that correct ?3. Would you like to add anything to that?4.Is that an accurate summary?5. Have you understood that correctly?6. Am I clear so far?7. Are you following me?8. Did you get the point?9. Isn\'t it?10. How do you feel about what I am proposing so far?11. Would you able to do this?12. Does this sound realistic?13. Does that sounds good?14. Would that be oky?15. Are you oky with tgis?16. Do you understood?17. Will that be oky?18. How does that sounds?','2025-01-20 21:47:52',0,1,'',NULL,NULL),(2475,46,266,'*Organising words*1. Most importantly..2. Inaddition to this...3. First of all...4. Secondly 5. Importantly 6. Finally 7. Lastly8. Considering this..9. Regarding...','202